import styled from "styled-components";

export const TableWrap = styled.div`
  TableHead {
    border-bottom: 1px solid #e8e8e8;
    padding: 0;
    font-size: 16px;
    padding: 10px 5px;
    font-weight: bold;
  }

  TableRow:hover {
    background-color: #eceaea;
    cursor: pointer;
  }

  td {
    padding: 10px 5px;
  }
`;
